script: |
  super -f text -I q12071.spq | sort > q12071.out

inputs:
  - name: q12071.spq
    data: |
      SELECT DISTINCT col1 AS col2 FROM tab2 (FORMAT parquet) WHERE col1 * - + col2 < col2 + - col1 - - 18 * + - col0 - - col0 AND ( - ( + 90 ) ) BETWEEN 45 + 14 * col1 AND NULL;
  - name: tab2

outputs:
  - name: q12071.out
    data: |
